import React, { Component } from "react";
import "./App.css";
import Todos from './components/Todos';

class App extends Component{

  state = {
    todos:[
        {
          id: 1,
          title: 'Take Out the Trash',
          completed: false
        },
        {
          id: 2,
          title: 'Dinner with wife',
          completed: false
        },
        {
          id: 3,
          title: 'Meeting with boss',
          completed: false
        },
    ]
  }

  render(){
    console.log(this.state.todos)
    return (
      <div className="App">
        <h1>App</h1>
        <Todos />
      </div>
    );
  }
}

export default App;
